import errNetwork from "../Pictures/errNetwork.jpg";
import baby_booster from "../Pictures/baby_booster.jpg";

function ErrNetwork() {
  return (
    <>
      <img className="imgCategory" src={errNetwork} />
    </>
  );
}
export default ErrNetwork;
